#if 1
//每8bit（4个字符）作为一个块来计算汉明距离
int HamDistance::getHamDistance(unsigned int int1, unsigned int int2, int l)
{

	unsigned int temp = int1 ^ int2;
	return hamCountTable1[temp & 65535] + hamCountTable1[(temp >> 16) & 65535];
//	return hamCountTable1[temp & 255] + hamCountTable1[(temp >> 8) & 255] + hamCountTable1[(temp >> 16) & 255] + hamCountTable1[(temp >> 24) & 255];
}
#endif

#if 1
//利用l自动判断需要几次求和
int HamDistance::getHamDistance_2(unsigned long long int1, unsigned long long int2, int l)
{
	unsigned long long temp = int1 ^ int2;
	int count = ceil(l / 4);
	int sum = 0;
	for (int i = 0; i < count; ++i)
	{
		sum = sum + hamCountTable1[(temp >> (i * 8)) & 255];
	}
	return sum;
}
#endif

